INSERT INTO `reviewkitchen` VALUES (1,1,5,'Огромное спасибо поварам за такую вкуснотищу. Безумно вкусные суши. И десертные блинчики супер)!',4),(2,2,20,'Очень вкусно и все на высшем уровне, особенно обслуживание. Суши самые вкусные. Открывайте больше точек и не жалейте конкурентов!!! Вы лучшие!!!',5),(3,3,4,'Очень, очень и очень вкусно!!!! Наисвежайшие суши, просто едим и еще хочется!!!Доставка долговато, но ради этой вкуснятины стоит подождать)))) Пожалуй лучшие суши в городе!',4),(4,4,10,'Самые вкусные суши в городе. Перепробовали много ресторанов, теперь заказываем только здесь.',4),(5,5,2,'Самые лучшие суши у вас! Респект су-шефу! Заказываем только у вас всегда, у других даже не хочется. Всегда свежие продукты, превосходный вкус. Хочется ещё попросить, чтоб добавили в меню горячие суши!!! Спасибо вам за то, что вы есть!',5),(6,6,11,'По поводу предновогодних праздников сделала заказ, для сотрудников, на суши Вашей компании. Очарованы сочетанием вкусовых качеств продуктов, их свежестью, оригинальностью исполнения. Чувствуется рука художника-сушиста!',5),(7,7,13,'Суши и роллы ОЧЕНЬ вкусные, качество на высоте, но есть два небольших «но»: - время выполнения доставки покороче бы, полтора часа - это слишком много - ОЧЕНЬ не хватает системы скидок для постоянных клиентов',5),(8,8,7,'Ребят , так держать ! Самые крутые суши в городе !! Цена и качество !!! Хороший и быстрый сервис !',5),(9,9,19,'ОГРОМНОЕ СПАСИБО!!! У вас Самые Вкусные роллы!!!! Испытала Огромное Удовольствие от сегодняшних роллов! Су-Шефу моё искреннее Спасибо!!!',5),(10,10,1,'Спасибо огромное за праздник!! Заказала по совету подруги и не прогадала!! очень было приятно также получить подарки от шеф-повара в честь дней рождения мужа и брата!! Сами суши большие, вкусные, свежие, оформление просто выше всяких похвал!!',5),(11,11,3,'Оочень осторожно отношусь к доставке еды на дом. Впервые сегодня заказали у вас суши-роллы и суп. Это было потрясающе вкусно! Как в хорошем ресторане, будем с мужем ваши клиентами